INSERT INTO public.pneu_tipo_desgaste_irregular (codigo, tipo_desgaste_irregular, descricao, aparencia_pneu, causas_provaveis, acao, precaucao, analisado_relatorio_desgastes) VALUES (1, 'DESGASTE_DIAGONAL', 'Desgaste diagonal', 'Desgastes localizados e acentuados em toda a circunferência.', 'Problemas mecânicos (desbalanceamento do conjunto, folgas nos rolamentos). Rodados duplos mal geminados e/ou pressões desiguais, desalinhamento do veículo e etc.', 'Retirar o pneu de serviço e enviar a um reformador. Importante fazer manutenção do veículo.', 'Realizar periodicamente a manutenção do veículo, sistema de freios, montagem e balanceamento dos pneus.', false);
INSERT INTO public.pneu_tipo_desgaste_irregular (codigo, tipo_desgaste_irregular, descricao, aparencia_pneu, causas_provaveis, acao, precaucao, analisado_relatorio_desgastes) VALUES (2, 'DESGASTE_ASSIMETRICO', 'Desgaste assimétrico', 'Áreas da banda de rodagem mais gastas em pontos alternados.', 'Problemas mecânicos (falhas na suspensão, desbalanceamento do conjunto, diferença de pressão entre duplos, folgas nos rolamentos e etc) agravados por rodagem sem carga e altas velocidades.', 'Retirar o pneu de serviço e enviar a um reformador. Importante fazer manutenção do veículo.', 'Realizar periodicamente a manutenção do veículo, sistema de freios, montagem e balanceamento dos pneus.', false);
INSERT INTO public.pneu_tipo_desgaste_irregular (codigo, tipo_desgaste_irregular, descricao, aparencia_pneu, causas_provaveis, acao, precaucao, analisado_relatorio_desgastes) VALUES (3, 'DESGASTE_OMBROS_BANDA_RODAGEM', 'Desgastes nos ombros da banda de rodagem', 'Ombros apresentam desgaste mais acentuado que o centro da banda de rodagem.', 'Rodagem com baixa pressão ou excesso de carga.', 'Calibrar os pneus com a pressão indicada conforme orientação do fabricante. Quando o desgaste atingir o TWI, em um dos pontos, retire os pneus para reforma ou reposição da borracha no ombro.', 'Calibrar periodicamente os pneus, sempre frios, e realizar inspeções visuais nos pneus.', true);
INSERT INTO public.pneu_tipo_desgaste_irregular (codigo, tipo_desgaste_irregular, descricao, aparencia_pneu, causas_provaveis, acao, precaucao, analisado_relatorio_desgastes) VALUES (4, 'DESGASTE_CENTRALIZADO', 'Desgaste centralizado', 'Desgaste na região central da banda de rodagem.', 'Pressão excessiva em relação à carga transportada ou equipamento de inflagem desregulado.', 'Ajustar a pressão com equipamento confiável conforme a carga. Para casos que o desgaste tenha atingido o TWI, retire para reforma.', 'Calibrar periodicamente os pneus, sempre frios, e de acordo com a orientação do fabricante.', true);
INSERT INTO public.pneu_tipo_desgaste_irregular (codigo, tipo_desgaste_irregular, descricao, aparencia_pneu, causas_provaveis, acao, precaucao, analisado_relatorio_desgastes) VALUES (5, 'DESGASTE_IRREGULAR_BLOCOS', 'Desgaste irregular nos blocos', 'Blocos desgastados irregularmente em toda a circunferência.', 'Baixa pressão, uso incorreto dos freios e desenhos inadequados.', 'Fazer rodízio para ajustar a altura dos pneus. Em casos em que o desgaste foi muito irregular, mantenha-os nas posições de uso.', 'Escolher desenhos adequados ao segmento. Calibrar os pneus conforme orientação do fabricante e sempre frios. Utilizar os freios a motor corretamente.', false);
INSERT INTO public.pneu_tipo_desgaste_irregular (codigo, tipo_desgaste_irregular, descricao, aparencia_pneu, causas_provaveis, acao, precaucao, analisado_relatorio_desgastes) VALUES (6, 'DESGASTE_ACENTUADO_UM_OMBRO_PNEU', 'Desgaste em um dos ombros do pneu', 'O pneu apresenta maior desgaste em um dos ombros, porém sem sinal de arraste.', 'Câmber do veículo incorreto, sobrecarga ou eixo empenado.', 'Realizar manutenção preventiva na suspensão do veículo.', 'Manter manutenção preventiva na suspensão do veículo.', true);
INSERT INTO public.pneu_tipo_desgaste_irregular (codigo, tipo_desgaste_irregular, descricao, aparencia_pneu, causas_provaveis, acao, precaucao, analisado_relatorio_desgastes) VALUES (7, 'DESGASTE_DEGRAUS', 'Desgaste em degraus', 'Desgaste em algumas raias dos desenhos de eixos livres.', 'Diferenças nas pressões e tamanhos dos pneus, folgas nos rolamentos, rodas inadequadas, mau assentamento dos talões. A alta velocidade sem carga agrava todos os fatores anteriores.', 'Retirar o pneu de uso e encaminhar a um reformador para reforma ou reparo. Importante realizar manutenção corretiva no veículo.', 'Realizar manutenção preventiva no veículo e nos pneus, principalmente a calibragem periódica.', false);
